import React from 'react'

import './itom-list.css'

export default class ItomList extends React.Component {

render(){ 
   const {usinItem} = this.props; 
   const element = this.props.peopleList.map((el)=>{
               const {id,type, pole} = el;
               return (
                   <li key ={id} className="btn-zeal"
                        onClick={()=>usinItem(id,type)}
                       >{pole}</li>
               );
    });

   return(
          <ul className = "itom-list list-group-item">
             {element}
         </ul>
   );
};
};
